import React from "react";
export default function Counter()
{
    return(
        <>
        <section className="counter_bg">
        <div className="container mt-5">
        <div className="row">
        <div className="col-md-4">
        <i class="fa-solid fa-car-rear fs-1 text-white mt-5"></i>
        </div>
        </div>
        </div>
        </section>
        </>
    )
}
